frontest.config(["$routeProvider","$httpProvider",function(e,t){e.when("/",{templateUrl:"pages/home.html",controller:"homeController"}).when("/login",{templateUrl:"pages/login.html",controller:"homeController"}),t.interceptors.push(["$q","$location","store",function(e,t,o){return{request:function(e){return e.headers=e.headers||{},null!==o.get("Cookie")?e.headers.Authorization=o.get("Cookie"):t.path("/login"),e},responseError:function(o){return(401===o.status||403===o.status)&&t.path("/login"),e.reject(o)}}}])}]);